window.bookSummaryJSON = "<p>Devon Sanders, a private investigator known for his efficiency and discretion, is determined to become a master wizard. He returns to the paranormal university ready to learn magic and uncover the history of the castle. Unfortunately, life at Quintessence is never that easy. </p> <p>When a student dies of no apparent cause, the search for a witness leads Devon to discover there are more secrets buried under Quintessence than he ever realized. In order to save the paranormal world he is now part of, he will face an enemy that can use his own power against him. Devon must rely on more than his exceptional intuition to solve this case. </p> <p>Magic is elemental. </p>"; 
